class StackedImages {
    private var images: [UIImage] = []
    private var iconScale: Double = 0.70

    init(images: [UIImage], iconScale: Double = 0.70) {
        self.images = images
        self.iconScale = iconScale
    }

    func stackImages() -> UIImage {
        let newWidth = images.reduce(0) { max($0, $1.size.width) }
        let iconsSize = floor(newWidth * iconScale).rounded(.down)
        let iconsInset = (newWidth - iconsSize) - 1

        let stackedImage = UIImage.init(size: CGSize(width: newWidth, height: newWidth))
        UIGraphicsBeginImageContextWithOptions(stackedImage.size, false, 0.0)
        let context = UIGraphicsGetCurrentContext()!
        context.setFillColor(UIColor.white.cgColor)
        context.fill(CGRect(x: 0, y: 0, width: newWidth, height: newWidth))

